import React, { Component } from 'react';

const Artist = (props) =>(
    <div className='artist'>
        <div>Place</div>
        <img src={props.image}/>
        <div>{props.name}</div>
        <div>{props.followers}</div>
        <div>{props.popularity}</div>
    </div>
)

export default Artist;
